use super::*;

fn test_uastc_mode(mode: usize) {
    let test_data = TEST_DATA_UASTC_ASTC[mode];
    for (uastc, expected_astc) in test_data.iter() {
        let mut actual_astc = [0; 16];
        decode_block_to_astc(uastc, &mut actual_astc);
        assert_eq!(&actual_astc, expected_astc, "\n{:02X?}\n{:02X?}\n{:02X?}", uastc, &actual_astc, expected_astc);
    }
}

#[test]
fn test_blocks_uastc_to_astc() {

    // CEM 8 - RGB Direct
    test_uastc_mode(0);
    test_uastc_mode(1);
    test_uastc_mode(2);
    test_uastc_mode(3);
    test_uastc_mode(4);
    test_uastc_mode(5);
    test_uastc_mode(6);
    test_uastc_mode(7);

    // Void-Extent
    test_uastc_mode(8);

    // CEM 12 - RGBA Direct
    test_uastc_mode(9);
    test_uastc_mode(10);
    test_uastc_mode(11);
    test_uastc_mode(12);
    test_uastc_mode(13);
    test_uastc_mode(14);

    // CEM 4 - LA Direct
    test_uastc_mode(15);
    test_uastc_mode(16);
    test_uastc_mode(17);

    // CEM 8 - RGB Direct
    test_uastc_mode(18);
}


